    "2015-11-10T01:36:47.207788",nt"name": "bathymetric-position-index-bpi-structures-5-m-grid-derived-from-gridded-bathymetry-of-kure-atol",nt"isopen":
    false,nt"url": null,nt"notes": "BPI Structures are derived from two scales
    of a focal mean analysis on bathymetry and slope. The grid is based on gridded (5
    m cell size) multibeam bathymetry, collected aboard R/V AHI merged with seafloor
    depths derived from IKONOS satellite imagery. BPI Structures was created using the
    Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/). Cell values represent
    one of 13 classes in an index of seafloor terrains. This data set is for the bank
    top, edge, and lagoon environments of Kure Atoll, Hawaii, USA.",nt"license_title":
